type ComponentPerfStats = {
  count: number;
  msTotal: number;
  msMin: number;
  msMax: number;
};

export type UseTelemetryResult = {
  setStart: () => void;
  setEnd: () => void;
};

export class Telemetry {
  performance: Record<string, ComponentPerfStats>;
  enabled: boolean;

  constructor() {
    this.performance = {};
    this.enabled = true;
  }

  reset() {
    this.performance = {};
  }
}
